void Transform0::operator()(Double_t *vars) const
{
	for (unsigned iVar = 0; iVar < 10; ++iVar)
		vars[iVar] = (vars[iVar] - mean[iVar]) / sigma[iVar];
}


NN::NN()
{}


void NN::SetWeightsL1(Double_t const weights[15][10])
{
	for (unsigned n = 0; n < 15; ++n)
		for (unsigned np = 0; np < 10; ++np)
			weightsL1[n][np] = weights[n][np];
}


void NN::SetBiasesL1(Double_t const biases[15])
{
	std::copy(biases, biases + 15, biasesL1);
}


void NN::SetWeightsL2(Double_t const weights[1][15])
{
	for (unsigned n = 0; n < 1; ++n)
		for (unsigned np = 0; np < 15; ++np)
			weightsL2[n][np] = weights[n][np];
}


void NN::SetBiasesL2(Double_t const biases[1])
{
	std::copy(biases, biases + 1, biasesL2);
}


Double_t const * NN::Apply(Double_t const *vars) const
{
	std::copy(vars, vars + 10, bufferIn);
	
	for (unsigned n = 0; n < 15; ++n)
	{
		bufferOut[n] = biasesL1[n];
	
		for (unsigned np = 0; np < 10; ++np)
			bufferOut[n] += weightsL1[n][np] * bufferIn[np];
	}
	
	for (unsigned n = 0; n < 15; ++n)
		bufferIn[n] = TMath::TanH(bufferOut[n]);
	
	for (unsigned n = 0; n < 1; ++n)
	{
		bufferOut[n] = biasesL2[n];
	
		for (unsigned np = 0; np < 15; ++np)
			bufferOut[n] += weightsL2[n][np] * bufferIn[np];
	}
	
	for (unsigned n = 0; n < 1; ++n)
		bufferIn[n] = 1. / (1 + TMath::Exp(-bufferOut[n]));
	
	return bufferIn;
}


